import React, { Fragment } from 'react';
import MobileLayoutLevel2 from '../../components/layouts/MobileLayoutLevel2';
import css from '../../styles/main.scss';
import OutlineBtn from '../../components/OutlineBtn';

const EditUserInfo = () => {
  const styles = {
    fontFamily: 'sans-serif',
    textAlign: 'center'
  };
  return (
    <Fragment>
      <MobileLayoutLevel2 title="變更資料">
        <div className={css.mobileEmpty} />
        <div className={css.mobileBox}>
          <div style={styles}>
            <Tabs
              activeTab={{
                id: 'tab1'
              }}
            >
              <Tabs.Tab id="tab1" title="Tab 1">
                <div style={{ padding: 10 }}>This is tab 1</div>
              </Tabs.Tab>
              <Tabs.Tab id="tab2" title="Tab 2">
                <div style={{ padding: 10 }}>This is tab 2</div>
              </Tabs.Tab>
            </Tabs>
          </div>
        </div>
      </MobileLayoutLevel2>
    </Fragment>
  );
};

export default EditUserInfo;
